import React from "react";
import "./foodcont.css";
import FoodBox from "./FoodBox";
import cards from "../img/chine.jpg";
import PaymentSect from "./PaymentSect";
import { Link } from "react-router-dom";
import plan0 from "../img/plan_BMC_R0.jpg";
import plan1 from "../img/plan_BMC_R1.jpg";
import plan2 from "../img/plan_BMC_R2.jpg";


function Chinese() {
    return (
        <>
            <div className="foodcontainer">
                <div className="left-side">
                    <div className="cards">
                        <div className="all">
                            <div className="varieties">
                                <Link to="/" className="var-btn">
                                    All
                                </Link>
                                <Link to="/african" className="var-btn">
                                    African
                                </Link>
                                <Link to="/Bib M-C" className="var-btn">
                                    Chinese
                                </Link>
                                <Link to="/italian" className="var-btn">
                                    Italian
                                </Link>
                                <Link to="/desert" className="var-btn">
                                    Desert
                                </Link>
                            </div>
                        </div>

                        <main>
                            <FoodBox imgSrc={plan0} title={"Chinese 1"} price={"$10"}/>
                            <FoodBox imgSrc={plan1} title={"Chinese 2"} price={"$25"}/>
                            <FoodBox imgSrc={plan2} title={"Chinese 6"} price={"$24"}/>
                        </main>
                    </div>
                </div>
                <div className="right-side">
                    <PaymentSect />
                </div>
            </div>
        </>
    );
}

export default Chinese;
